// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SelfAppRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SelfApp) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSelfAppByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSelfAppUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSelfAppByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppByPackageNamePrefix, item.PackageName)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppUnscopedByPackageNamePrefix, item.PackageName)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
